import React from 'react';
import Employees from './pages/Employees';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={ <Employees /> } />
      </Routes>
    </div>
  );
}

export default App;
